import React from 'react';
import { motion } from 'framer-motion';
import 'tailwindcss/tailwind.css';

const ProjectRacc = () => {
  const features = [
    "Real-time Raccoon Tracking",
    "Educational Resources on Raccoon Safety",
    "Community Engagement Platform",
    "Enhanced Visuals and Interactivity",
    "Seamless User Experience"
  ];

  const techStack = [
    { name: "React", description: "Component-based UI for interactive experiences." },
    { name: "Tailwind CSS", description: "Utility-first CSS for responsive and modern design." },
    { name: "Node.js", description: "Backend runtime for efficient server-side logic." },
    { name: "MongoDB", description: "Scalable and flexible NoSQL database." }
  ];

  return (
    <div className="bg-gray-900 text-gray-100 min-h-screen py-12 px-4 sm:px-8">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="max-w-4xl mx-auto"
      >
        <h1 className="text-4xl font-extrabold text-center text-indigo-500">RaccTracc</h1>
        <p className="mt-6 text-lg leading-relaxed text-center">
          Discover the world of raccoons at UCSD! RaccTracc enhances your raccoon-watching experience with real-time tracking, 
          educational resources, and a vibrant community of enthusiasts. Join us to celebrate these fascinating creatures.
        </p>

        <div className="mt-12 grid gap-8 sm:grid-cols-2">
          <motion.div
            whileHover={{ scale: 1.05 }}
            className="bg-gray-800 p-6 rounded-lg shadow-lg hover:shadow-2xl"
          >
            <h2 className="text-xl font-bold text-indigo-400">Purpose</h2>
            <p className="mt-4">
              Inspired by the @ucsd.raccoons Instagram page, we created RaccTracc to provide real-time raccoon tracking, 
              build a passionate community, and educate users about raccoon safety and behavior.
            </p>
          </motion.div>

          <motion.div
            whileHover={{ scale: 1.05 }}
            className="bg-gray-800 p-6 rounded-lg shadow-lg hover:shadow-2xl"
          >
            <h2 className="text-xl font-bold text-indigo-400">Features</h2>
            <ul className="mt-4 space-y-2 list-disc list-inside">
              {features.map((feature, idx) => (
                <li key={idx} className="text-gray-300">{feature}</li>
              ))}
            </ul>
          </motion.div>
        </div>

        <div className="mt-12">
          <h2 className="text-2xl font-bold text-center text-indigo-400">Our Tech Stack</h2>
          <div className="mt-8 grid gap-6 sm:grid-cols-2 lg:grid-cols-4">
            {techStack.map((tech, idx) => (
              <motion.div
                key={idx}
                whileHover={{ scale: 1.1 }}
                className="bg-gray-800 p-4 rounded-lg shadow-lg hover:shadow-2xl text-center"
              >
                <h3 className="text-xl font-semibold text-indigo-300">{tech.name}</h3>
                <p className="mt-2 text-gray-400 text-sm">{tech.description}</p>
              </motion.div>
            ))}
          </div>
        </div>

        <div className="mt-16 text-center">
          <motion.button
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.95 }}
            className="px-6 py-3 bg-indigo-500 text-white rounded-full shadow-lg hover:bg-indigo-600 focus:outline-none"
          >
            Explore More Projects
          </motion.button>
        </div>
      </motion.div>
    </div>
  );
};

export default ProjectRacc;
